import React from 'react';
import { Navbar, Nav, NavDropdown, Button } from 'react-bootstrap';
import { useHistory } from 'react-router-dom'; // Import useHistory hook from react-router-dom

function CostumNavbar() {
    const history = useHistory(); // Initialize useHistory hook

    // Function to handle the click event on the "Your Profile" button
    const handleProfileClick = () => {
        // Check if the user is logged in (You need to implement your own authentication logic here)
        const isLoggedIn = true; // Assuming the user is logged in (You need to replace this with your actual authentication logic)

        // If the user is logged in, redirect to the profile page, else redirect to the login page
        if (isLoggedIn) {
            history.push('/profile'); // Redirect to the profile page
        } else {
            history.push('/login'); // Redirect to the login page
        }
    };

    return (
        <Navbar expand="lg" bg="white" variant="light" className="shadow sticky-top p-0">
            <Navbar.Brand href="#" className="d-flex align-items-center text-center py-0 px-4 px-lg-5">
                <h1 className="m-0 text-primary">CareerConnect</h1>
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="navbarCollapse" className="me-4" />
            <Navbar.Collapse id="navbarCollapse">
                <Nav className="ms-auto p-4 p-lg-0">
                    <Nav.Link href="#" className="nav-item nav-link active">Home</Nav.Link>
                    <Nav.Link href="#" className="nav-item nav-link">About</Nav.Link>
                    <NavDropdown title="Apliko" id="basic-nav-dropdown" className="nav-item dropdown">
                        <NavDropdown.Item href="./JobListing">Pune</NavDropdown.Item>
                        <NavDropdown.Item href="#">Praktike</NavDropdown.Item>
                        <NavDropdown.Item href="#">Kurse</NavDropdown.Item>
                    </NavDropdown>
                    <Nav.Link href="#" className="nav-item nav-link">Posto shpallje</Nav.Link>
                </Nav>
                <Button variant="primary" className="rounded-0 py-4 px-lg-5 d-none d-lg-block" onClick={handleProfileClick}>
                    Your Profile<i className="fa fa-arrow-right ms-3"></i>
                </Button>
            </Navbar.Collapse>
        </Navbar>
    );
}

export default CostumNavbar;
